import React, { Component } from 'react';
import {
   HTMLTable,
   Button,
   NonIdealState,
   H5,
   Spinner,
   ContextMenuTarget,
   Menu,
   MenuItem,
   ContextMenu
} from '@blueprintjs/core';

import Client from '../../../Modules/Client/Client';

export default class UsersTable extends Component {
   constructor(props) {
      super(props);
      this.state = {
         users: [],
         isLoading: true,
         errorMsg: ''
      };
   }
   componentDidMount() {
      this.getData();
   }
   setLoading(loading) {
      this.setState({
         isLoading: loading
      });
   }
   resetErrorMsg() {
      this.setState({
         errorMsg: ''
      });
   }
   async getData() {
      this.setLoading(true);
      var result;
      try {
         this.resetErrorMsg();
         result = await Client.Services.UsersService.getUsers();
         this.setState({
            users: result.data
         });
         console.log(this.state.users);
      } catch (err) {
         this.setState({ errorMsg: err.response.status });
         Client.Notifications.alert('Error while loading users list');
      } finally {
         this.setLoading(false);
      }
   }
   renderTableHeader() {
      return (
         <thead>
            <tr>
               <th>User Name</th>
               <th>Role</th>
               <th>Role</th>
               <th className='text-center'>Action</th>
            </tr>
         </thead>
      );
   }
   renderTableBody() {
      return <tbody>{this.renderTableRows()}</tbody>;
   }
   renderTableRows() {
      return this.state.users.map(user => {
         return (
            <tr key={user._id} onClick={e => this.handeClick(e, user._id)}>
               <td>{user.username}</td>
               <td>{user.email}</td>
               <td>{user.role}</td>
               <td className='text-center'>
                  <Button minimal icon='more'></Button>
               </td>
            </tr>
         );
      });
   }
   handeClick(e, id) {
      e.preventDefault();
      ContextMenu.show(this.renderContextMenu(e));
   }
   renderContent() {
      if (this.state.errorMsg) {
         return (
            <NonIdealState icon='issue'>
               <H5>
                  <strong>Something went wrong</strong>
               </H5>
               <i>Cannot load users table</i>
               <Button
                  icon='refresh'
                  minimal
                  onClick={() => this.getData()}
               ></Button>
            </NonIdealState>
         );
      }
      return (
         <HTMLTable fill condensed striped interactive>
            {this.renderTableHeader()}
            {this.renderTableBody()}
         </HTMLTable>
      );
   }

   renderContextMenu(e) {
      return (
         <Menu>
            <MenuItem icon='select' text='Select all' />
            <MenuItem icon='insert' text='Insert...'>
               <MenuItem icon='new-object' text='Object' />
               <MenuItem icon='new-text-box' text='Text box' />
               <MenuItem icon='star' text='Astral body' />
            </MenuItem>
            <MenuItem icon='layout' text='Layout...'>
               <MenuItem icon='layout-auto' text='Auto' />
               <MenuItem icon='layout-circle' text='Circle' />
               <MenuItem icon='layout-grid' text='Grid' />
            </MenuItem>
            <Menu.Divider />
            <MenuItem
               disabled={true}
               text={`Clicked at (${e.clientX}, ${e.clientY})`}
            />
         </Menu>
      );
   }

   render() {
      if (this.state.isLoading) {
         return <Spinner intent='primary'></Spinner>;
      }
      return <div>{this.renderContent()}</div>;
   }
}
